import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Banner from "./components/Banner";
import Home from "./pages/Home";

function App() {
  const routes = [
    {
      path: "/",
      level: "all",
      title: "Employees",
    },

    {
      path: "/executives",
      level: "executives",
      title: "Executives",
    },

    {
      path: "/mids",
      level: "mids",
      title: "Mid Managements",
    },

    {
      path: "/juniors",
      level: "juniors",
      title: "Juniors",
    },
  ];

  return (
    <BrowserRouter>
      <Routes>
        <Route
          path={routes[0].path}
          element={
            <Banner title={routes[0].title}>
              <Home routes={routes} />
            </Banner>
          }
        />
        <Route
          path={routes[1].path}
          element={
            <Banner title={routes[1].title}>
              <Home routes={routes} />
            </Banner>
          }
        />
        <Route
          path={routes[2].path}
          element={
            <Banner title={routes[2].title}>
              <Home routes={routes} />
            </Banner>
          }
        />
        <Route
          path={routes[3].path}
          element={
            <Banner title={routes[3].title}>
              <Home routes={routes} />
            </Banner>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
